description:
In the near future as fear of terrorism escalates, privacy is a luxury of the past. Now, in people's homes, on the streets, in the workplace, everyone is constantly being watched by mobile robotic cameras known as &quot;Eyeborgs.&quot;

But are the cameras just watching... or are they up to something else? 

As an increasing number of people die in bizarre ways, federal agent Gunner Reynolds is determined to find out after he realizes that a camera has recorded an event much differently than he recalls...
